import { Container, Row, Col, Button, Card } from "react-bootstrap";
function Priority() {
  return (
    <div style={{ backgroundColor: "#f1f0ec" }}>
      <br />

      <Container>
        <br />
        <br />
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <center>
          <font style={{ fontSize: "22px" }}>
            Your Comfort Is Our #1 Priorit
          </font>
        </center>
        <br />
        <br />
        <center>
          <Row style={{ justify: "center", width: "70%" }}>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card
                style={{
                  width: "100%",
                  height: "100%",
                  border: "0px",
                  backgroundColor: "#f1f0ec",
                }}
              >
                <Card.Img variant="top" src="./assets/img/4.png" />
                <Card.Body>
                  <label
                    style={{
                      marginLeft: "-15px",
                      fontSize: "14px",
                    }}
                  >
                    Quality products
                  </label>
                  <br />
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      fontSize: "12px",
                      color: "#868686",
                    }}
                  >
                    Lorem ipsum dolor sit amet,
                  </label>
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      fontSize: "12px",
                      color: "#868686",
                    }}
                  >
                    consectetur adipiscing elit, sed do
                  </label>
                </Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "100%", border: "0px" }}>
                <Card.Img variant="top" src="./assets/img/2.png" />
                <Card.Body>
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    Product Name
                  </label>
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    AED XXX
                  </label>
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    Special Offer Get 25% OFF
                  </label>
                </Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={4}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "100%", border: "0px" }}>
                <Card.Img variant="top" src="./assets/img/3.png" />
                <Card.Body>
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    Product Name
                  </label>
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    AED XXX
                  </label>
                  <br />
                  <label
                    style={{
                      marginLeft: "-15px",
                      float: "left",
                      fontSize: "14px",
                    }}
                  >
                    Available in 3 color
                  </label>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </center>
      </Container>
      <br />
      <br />
      <br />
      <br />
    </div>
  );
}
export default Priority;
